import React from 'react';
import { useNavigate } from 'react-router-dom';
import styles from './Login.module.css';
import 'bootstrap/dist/css/bootstrap.min.css';

const Login = () => {
  const navigate = useNavigate();

  return (
    <div className="container d-flex justify-content-center align-items-center vh-100">
      <div className={`card ${styles.box}`}>
        <h1 className={`card-title ${styles.title}`}>Preencha os campos abaixo para acessar o Menu</h1>
        <form>
          <div className="form-group">
            <label className={styles.formLabel} htmlFor="cpf">CPF</label>
            <input type="text" className={`form-control ${styles.input}`} id="cpf" placeholder="___.___.___-__" />
          </div>
          <div className="form-group">
            <label className={styles.formLabel} htmlFor="senha">Senha</label>
            <input type="password" className={`form-control ${styles.input}`} id="senha" />
          </div>
          <button type="button" className="btn btn-primary w-100 mt-3" onClick={() => navigate('/Menu')}>
            Entrar
          </button>
          <button type="button" className="btn btn-secondary w-100 mt-2" onClick={() => navigate('/')}>
            Voltar
          </button>
        </form>
        <p className={`card-text ${styles.rodape}`}>Desenvolvido por Leonardo W O Dias</p>
      </div>
    </div>
  );
};

export default Login;
